import React, { Component } from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import pont from '../styles/font.css';

class Navigation extends Component {

  
    render() {
      return (
        <Nav>
            <NavList>
            <NavItem><Link to='/about' style={{ textDecoration: 'none',color:'white'  ,fontFamily: 'Jua, sanserif'}}>About</Link></NavItem>
                <NavItem><Link to='/board' style={{ textDecoration: 'none',color:'white'  ,fontFamily: 'Jua, sanserif'}}>Project</Link></NavItem>
                <NavItem><Link to='/myboard' style={{ textDecoration: 'none' ,color:'black'  ,fontFamily: 'Jua, sanserif' }}>Board</Link></NavItem>
                <NavItem><Link to='/comment' style={{ textDecoration: 'none' ,color:'black'  ,fontFamily: 'Jua, sanserif' }}>Guest</Link></NavItem>
                <NavItem><Link to='/mypage' style={{ textDecoration: 'none' ,color:'black'  ,fontFamily: 'Jua, sanserif'}}>Me</Link></NavItem>
            </NavList>
        </Nav>
      );
    }
  }
  
export default Navigation;

const Nav = styled.div`
    width: 100%;
    height: 140%;
    border-top: none;
    border-bottom: 0.5px solid black;
    background-color:black;
   
`

const NavList = styled.ul`
    width: 1080px;
    display: flex;
    margin: 0 auto;
   
    position:relative;
    
`

const NavItem = styled.li`
    width: 100px;
    margin-top:5px;
    display: flex;
    color: black;
    float:right;
    position:relative;

`
